import React from 'react';
import './Menu.css';
import Tab from "./Tab";

function Menu({ menuEntry, onSelect }) {
    console.log(menuEntry)
    return (
        <div className="menu">

            {Object.keys(menuEntry).forEach(key => {
                console.log('Key:', key);
                console.log('Value:', menuEntry[key]);
                <button onClick={() => onSelect(key)}>Characters</button>
            })}

        </div>
    );
}

export default Menu;
